import React, { Component } from 'react';

class Popup extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        if (this.props.selectRestorant) {
            return (
                <div id="popup">
                    <div id="popmenu">
                        <p>{this.state.selectRestorant}</p>
                        <div className="exit">닫기</div>
                    </div>
                </div>
            );
        }
        else {
            return (
                <div id="popup">
                    <div id="popmenu">
                        <p>{this.state.selectRestorant}</p>
                        <div className="exit">닫기</div>
                    </div>
                </div>
            );
        };
    }
}

export default Popup;
